import Typography from "@mui/material/Typography";

const Title = () => {
  return (
    <Typography
      align="center"
      fontWeight="700"
      color="primary"
      variant="h6"
      component="h6"
      gutterBottom={true}
    >
      EMI Calculator
    </Typography>
  );
};

export default Title;
